in_source: |-
  section .data
      pos: 10
      stop_number: 0
      char: 0
      stop_char: 10
  section .text
      mov %rax .read
      mova %rax #ADDR_TO_INT
      ei
      .read_loop
          mov %rax #char
          cmp %rax #stop_char
          jz .fib
          jmp .loop
      .read
          movi %rax !0
          mova %rax &char
          cmp %rax #stop_char
          jnz .wr
          jmp .ret
          .wr
              mova %rax &stop_number
          .ret
              iret
     .fib
      mov %rax 1
      mov %rdx 1
      mov %rbx 0
      .loop
          mov %rax %rdx
          add %rax %rbx
          mov %rbx %rdx
          mov %rdx %rax
          cmp %rax #stop_number
          jp .print
          mod %rax 2
          jz .count
          jmp .loop
      .count
          add %rcx %rdx
          jmp .loop
      .print
          mov %rax %rcx
          .select_digit
              cmp %rax #pos
              jn .print_char
              div %rax 10
              jmp .select_digit
      .print_char
          mov %rdx %rax
          mod %rax 10
          add %rax 48
          movo %rax !1
          cmp %rdx %rcx
          jz .end
          mov %rax #pos
          mul %rax 10
          mova %rax &pos
          jmp .print
      .end
          hlt
